var title_f1_49_1822="Survival in flail MV leaflet";
var content_f1_49_1822=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F73457&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F73457&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 550px\">",
"   <div class=\"ttl\">",
"    Long-term survival in flail mitral leaflet",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 530px; height: 196px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among 229 patients with isolated mitral regurgitation due to a flail mitral leaflet, long-term survival was related to NYHA class (left panel) and left ventricular ejection fraction (LVEF) (right panel). Mortality was higher in patients with poor left ventricular function as indicated by more significant clinical heart failure (class III or IV) and lower EF (&lt;60 percent).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Ling LH, Enriquez-Sarano M, Steward JB, et al. N Engl J Med 1996; 335:1417.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
